import React from "react";
import "./Dashboard.css";
const Dashboard = () => {
  const button = document.getElementsByTagName("p");
  return (
    <aside>
      <div>
        <p>Create Proposal</p>
      </div>

      <div>
        <p>Execute Proposal</p>
      </div>
      <div>
        <p>Transfer Shares</p>
      </div>
      <div>
        <p>Reedem Shares</p>
      </div>
    </aside>
  );
};
export default Dashboard;
